import React, { useState } from 'react'

const Home = () => {

  const [Students, setStudents] = useState([0])

  return (
    <div id="main">
      <h1 className='text-center'>Active Students</h1>
      <div id='outer-box'>
        <div id="box1" className='boxes'>Active Students : {Students}</div>
        <div id="box2" className='boxes'>This is Index</div>
        <div id="box3" className='boxes'>This is Index</div>
        <div id="box4" className='boxes'>This is Index</div>
      </div>
    </div>
  )
}

export default Home
